  true,\n\t\"url\": null,\n\t\"notes\": \"This study describes current methods of
  direct certification used by State and local agencies and the challenges that State
  and local education agencies face in attaining high matching rates.  The study presents
  the analysis of unmatched records in order to provide a better understanding of
  the categorically eligible children who are not matched in the direct certification
  process and identifies potential matching process improvements that might increase
  the number of matched children.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
